import React from 'react'
import homepic from '../assets/homepic.png'
import Mask from '../assets/mask-image.png'; // Replace with the path to your wave mask image
import wave from '../assets/wave.svg';
function Home() {

    const hometext = {
        fontFamily: 'ITC Franklin Gothic LT', 
        fontSize: '55px', 
        marginTop: '180px',
        marginLeft:'150px',
        whiteSpace: 'pre-line', // Allow line breaks
        fontWeight:'bold'
    };
    const homepicture = {
        width: '900px',
        height: '500px',
        WebkitMaskImage: `url(${Mask})`, // WebKit browsers (Chrome, Safari)
        maskImage: `url(${Mask})`, // Standard property
        maskSize: 'cover', // Adjust as needed
        marginLeft:'750px',
        marginTop:'-200px',
        border: '15px solid #63821b',

      };
      const hometext2 = {
        fontSize: '50px',
        marginLeft: '20px',
        marginBottom: '-20px',
        fontColor:'white',
        whiteSpace: 'pre-line', // Allow line breaks
      };
      const hometext2container = {
        width: '50%',
        height: '300px',
        backgroundImage: `url(${wave})`, // SVG as a background image
        borderRadius: '0 0 50% 50% / 20px', /* Adjust the values to control the wave */
        marginBottom: '0px', // Adjust the top margin
        marginLeft: '-20px', // Adjust the left margin
        overflow: 'hidden', // Hide overflow caused by border-radius
      }

  return (
    <div style = {height = '100%'}>
        <div style = {hometext}>Changing the Face of {'\n'}Irish Food Education</div>
        <div><img src={homepic} alt="homepic" style={homepicture} /></div>
        <div style = {hometext2container}>
            <div style = {hometext2}>By the time our children are adults,{'\n'} 
            they won't know how to cook.{'\n'} We want to change that</div>
        </div>

    </div>

  )
}

export default Home
